import React from "react";
import "../App.css";
import { Introduction } from "../components/introduction";
import Firstpage from "../components/firstpage";

const Home = () => {
  return (
    <>
      <div>
        <Firstpage />
        <Introduction />
      </div>
    </>
  );
};

export default Home;
